// import { Dropdown } from 'bootstrap';
// import Logo from '../Images/Logo.png';
import { GrApple } from 'react-icons/gr';
function HomePage() {
	return (
		<div class='border border-danger d-flex flex-row gap-3'>
			<div class='p-3 d-inline-flex border border-danger'>
				<h1>MeowMeow</h1>
			</div>
			<div class='p-3 d-inline-flex border mt-4 mb-2'>
				<h6>MeowMeow</h6>
			</div>
			<div class='p-3 d-inline-flex border mt-4 mb-2'>
				<h6>MeowMeow</h6>
			</div>
			<div class='p-3 d-inline-flex border mt-4 mb-2'>
				<h6>MeowMeow</h6>
			</div>
			<div class='p-3 d-inline-flex border mt-4 mb-2'>
				<h6>MeowMeow</h6>
			</div>
			<div class='p-3 d-inline-flex border mt-3 mb-2 '>
				<input class='form-control me-2' type='text' placeholder='Search' />
			</div>
			<div class='border border-danger p-3 mt-5 d-inline-flex'>
				<GrApple />
			</div>
		</div>
	);
}

export default HomePage;
